import React from 'react'
import "./Home.css";
const Home = () => {
  return (
    <section id='home' className='home'>
      <h2>Konar Hukuk & Danışmanlık Bürosu olarak, adaleti savunma yolunda her adımda yanınızdayız; güven, çözüm ve başarıyı birlikte inşa ediyoruz...</h2>
    </section>
    
  )
}

export default Home
